import React, { Component } from 'react';

// HEADER
const Header = () => {
  return(
    <header>
      <h1>To Do List</h1>
      <span>#</span>
    </header>
  );
}

// TASK LIST
const Task = () => {
  return(
    <div className="task-item">
      <span className="task-delete">&#10006;</span>
      <span className="task-text">Task 1</span>
    </div>
  );
}

// ADD NEW TASK FORM
const AddTaskForm = () => {
  return(
    <footer>
      <form>
        <input
          className="input"
        />
        <input
          className="button"
          type="button"
          value="Add Task"
        />
      </form>
    </footer>
  );
}

class App extends Component {

  render() {
    return (
      <div class="wrapper">

        <Header />

        <div className="task-wrapper">
          <Task />
        </div>

        <AddTaskForm />

      </div>

    );
  }
}
export default App;
